import React, { Component } from 'react';
import { Map, GoogleApiWrapperมMarker  } from 'google-maps-react';


const mapStyles = {
  width: '100%',
  height: '100%'
};

export class MapContainer extends Component {
  render() {
    return (
      <Map
        google={this.props.google}
        zoom={14}
        style={mapStyles}
        initialCenter={{
         lat: 18.796143,
         lng: 98.979263
        }}
      />
    );
  }
}


export default GoogleApiWrapper({
  apiKey: 'AIzaSyCZ1BCe4Q7YL1nCa_ovtet4Bjn52tT20T8'
})(MapContainer);
